import React from 'react'
import { ApolloProvider } from '@apollo/react-hooks'
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import RandomRecipe from './components/recipe/random_recipe/RandomRecipe';
import RecipeSearch from './components/recipe/recipe_search/RecipeSearch';
import { InMemoryCache } from 'apollo-boost';
import ApolloClient from 'apollo-client';
import UserSignup from './components/user/signup/UserSignup';
import { recipe } from './resolvers'
import RecipeView from './components/recipe/recipe_view/RecipeView';
import MyShoppingLists from './components/shoppingList/my_shopping_lists/MyShoppingLists';
import ViewShoppingList from './components/shoppingList/view_shopping_list/ViewShoppingList';
import NavBar from './components/navbar/NavBar';
import mrCresoote from './assets/mr-creosote.jpeg';
import { link } from './websocketSetup'
import './App.css'

const cache = new InMemoryCache();
const init = {
  data: {
    ingredients: [],
  },
}
cache.writeData(init);

const client = new ApolloClient({
  link,
  cache,
  resolvers: recipe,
});

function App () {
  return (
    <ApolloProvider client={client}>
      <BrowserRouter>
        <NavBar />
        <Switch>
          <Route exact path='/' component={() => <section className="section"> <div className="container has-text-centered"><img src={mrCresoote} alt="Just a mint leaf"/></div> </section>} />
          <Route exact path='/random' component={RandomRecipe} />
          <Route exact path='/search' component={RecipeSearch} />
          <Route exact path='/signup' component={UserSignup} />
          <Route exact path='/shopping-lists' component={MyShoppingLists} />
          <Route exact path='/recipe/:id' component={RecipeView} />
          <Route exact path='/shopping-list/:id' component={ViewShoppingList} />
        </Switch>
      </BrowserRouter>
    </ApolloProvider>
  )
}

export default App
